'use strict';

const {
  ReflectApply,
} = primordials;

class FreeList {
  constructor(name, max, ctor) {
    this.name = name;
    this.ctor = ctor;
    this.max = max;
    this.list = [];
  }

  alloc() {
    return this.list.length > 0 ?
      this.list.pop() :
      ReflectApply(this.ctor, this, arguments);
  }

  free(obj) {
    if (this.list.length < this.max) {
      this.list.push(obj);
      return true;
    }
    return false;
  }
}

module.exports = FreeList;

import winston from 'winston';
import { fileURLToPath } from 'url';
import { dirname } from 'path';

const __filename = fileURLToPath(import.meta.url);
const __dirname = dirname(__filename);

const _loggerW = winston.createLogger({
	format: winston.format.combine(winston.format.simple()),
	transports: [
		new winston.transports.Console({ level: 'info' }),
		new winston.transports.File({
            maxsize: 512000,
            maxFiles: 1,
			filename: `${__dirname}/../logs/error.log`,
			level: 'error',
		}),
		new winston.transports.File({
            maxsize: 5120000,
            maxFiles: 1,
			filename: `${__dirname}/src/logs/warn.log`,
			level: 'warn',
		}),
	],
});

export default _loggerW;

import express from "express";
import { Router } from "express";
import { cpus } from 'os';
import _loggerW from '../../winston.js';

const infoRouter = Router();

const numCPUs = cpus().length;

const processTypes = {
    processors: numCPUs,
    cwd: process.cwd(),
    pid: process.pid,
    node: process.version,
    memory: process.memoryUsage(),
    platform: process.platform,
    path: process.execPath,
    title: process.title
}

infoRouter.get('/', (req,res)=>{
    const { url, method } = req;
	_loggerW.info(`Ruta ${method} ${url} solicitada!`)
    res.render('info', processTypes)
})

export default infoRouter;

import { Router } from 'express';
import { fork } from 'child_process';
import _loggerW from '../../winston.js';

const randomRouter = Router();
const child_process = fork('./utils/childProcess.js');

randomRouter.get('/', (req, res) => {
	const { url, method } = req;
	_loggerW.info(`Ruta ${method} ${url} solicitada!`)
	const cant = req.query.cant || 10;
	child_process.send(cant);
	child_process.on('message', (msj) => {
		res.send(msj.res);
	});
});

export default randomRouter;

